import { Navbar, Container, Nav } from 'react-bootstrap'
import './navBar.css'

function NavBar() {
    return (
        <div className="navbar">
            <Navbar bg="dark" variant="dark">
                <Container className="container-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="/">Home</Nav.Link>
                    </Nav>
                </Container>
            </Navbar>
        </div>
    );
}

export default NavBar;
